import './categories.styles.scss';
import Categori from './component/categories/categories.jsx'

function App() {

  const categories = [
    {
      id: 1,
      title: 'Hats',
    },
    {
      id: 2,
      title: 'Jackets',
    },
    {
      id: 3,
      title: 'SneaKers',
    },
    {
      id: 4,
      title: 'Womens',
    },
    {
      id: 5,
      title: 'Mens',
    },
  ]

  return (
    <div className="App">
      <div className="categories-container">
        {categories.map((hello) =>
          <Categori Category={hello} />
        )}
      </div>
    </div>
  );
}

export default App;
